import React from "react";
import { useParams } from "react-router-dom";
import { useState } from "react";
import { styled } from '@mui/material/styles';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell, { tableCellClasses } from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';



const StyledTableCell = styled(TableCell)(({ theme }) => ({
    [`&.${tableCellClasses.head}`]: {
      backgroundColor: theme.palette.common.black,
      color: theme.palette.common.white,
    },
    [`&.${tableCellClasses.body}`]: {
      fontSize: 14,
    },
  }));
  function createData(name) {
    return { name };
  }
  const rows = [
    createData('Main Campus'),
    createData('Dorm'),
    createData('East Campus'),

  ];

  const StyledTableRow = styled(TableRow)(({ theme }) => ({
    '&:nth-of-type(odd)': {
      backgroundColor: theme.palette.action.hover,
    },
    // hide last border
    '&:last-child td, &:last-child th': {
      border: 0,
    },
  }));


function Reservation() {
    const { reservationId } = useParams();
    const[checkedState, setCheckedState] = useState(new Array(rows.length).fill(false));

    const handleOnChange = (position) => {
        const updateAllStates = checkedState.fill(false);
        setCheckedState(updateAllStates);
        const updatedCheckedState = checkedState.map((item, index) => index === position ? !item: item);
        setCheckedState(updatedCheckedState);
    }

    return (
        <>
            <div className="centerContainer">
            <TableContainer component={Paper}>
      <Table sx={{ width: '30%', backgroundColor: 'red'}} aria-label="customized table">
        <TableHead>
          <TableRow>
            <StyledTableCell>Sports Center</StyledTableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row, index) => (
            <StyledTableRow key={row.name}>
              <StyledTableCell component="th" scope="row" key={"button" + row.key} onClick={() => {handleOnChange(index)}} >
                    {row.name}
                    {checkedState[index].toString()}
              </StyledTableCell>
            </StyledTableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
            </div>

        </>

    );


}

export default Reservation;
